import React from "react";
import { Link } from "react-router-dom";
import { Audioset, AudiosetMetadata } from "../../lib/audioset";

type HeaderProps = {
  meta: AudiosetMetadata;
};

export const Header = ({ meta }: HeaderProps) => {
  return (
    <div className="header">
      {meta.path === "index" ? (
        <img
          style={{ maxHeight: "2rem" }}
          className="play-logo"
          src="/play-logo.png"
          alt="Play antropoloops"
        />
      ) : (
        <>
          <Link to={`/set/${meta.parent_path}`}>&lt;&lt;&nbsp;</Link>

          <span>{meta.title}</span>
        </>
      )}
    </div>
  );
};
